import Navbar from "react-bootstrap/Navbar";
import Button from 'react-bootstrap/Button';
import Overlay from "react-image-overlay";
import ReactDOM from "react-dom";
import "react-responsive-carousel/lib/styles/carousel.min.css";
import { Carousel } from "react-responsive-carousel";
// const Slideshow = require("react-slidez");


import '../css/custom.css'





const Index = () => (
  <>
    <div>
      <nav className="navbar navbar-light bg-light trn">
        <a className="navbar-brand" href="#">
          <img
            src="https://res.cloudinary.com/dalnnaod7/image/upload/v1587000246/lk_logo_hets9i.png"
            width="56"
            height="56"
            className="d-inline-block align-top brand"
            alt=""
          />
        </a>
        <form className="form-inline ">
          <button
            id="menu-btn"
            className="navbar-toggler"
            type="button"
            data-toggle="collapse"
            data-target="#navbarToggleExternalContent"
            aria-controls="navbarToggleExternalContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
        </form>
      </nav>
